INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Controller Dj Pioneer Ddj-sx3', 'CONSOLLE DJ 4 CANALI PER SERATO DJ PRO Ampliando le funzioni della popolare console Pioneer DDJ-SX2, il modello DDJ-SX3 è solido eppure portatile, con un layout familiare e jog wheel a latenza più bassa. Traboccante di funzioni avanzate, questa console è l’ideale per i DJ professionisti che si esibiscono in night, feste, matrimoni ed eventi aziendali. Collabora con MC, rapper o cantanti, inserendo 3 diversi microfoni contemporaneamente attraverso i 3 ingressi mic, controlla poi EQ e applica effetti ad ognuno. Collega 2 computer contemporaneamente per facili cambi di guardia tra DJ con le doppie porte USB. E grazie a Pitch’n Time DJ e Serato Flip Expansion Pack, inclusi gratuitamente, potrai eseguire stretch, mix e cut di precisione. Che tu ti esibisca con MC, cantanti o altri ospiti, 3 persone possono intrattenere la folla contemporaneamente con i 3 ingressi mic. Assicurati un parlato nitidissimo con l’EQ a 3 bande, il filtro low-cut, il compressore ed il controllo Reverb su ognuno di essi. Esalta poi le performance vocali con Sound Colour FX e Serato DJ Pro FX. Si possono collegare 2 computer contemporaneamente per transizioni senza soluzione di continuità tra i DJ, performance back-to-back o come computer di backup, in caso di guasto del portatile. Con un layout ereditato dalle console Serato di punta, avrai dimestichezza nell’utilizzare il DDJ-SX3. Grazie ai 4 ingressi puoi collegarlo a CDJ, giradischi analogici e utilizzarlo come mixer DJ standalone. Collega vari diffusori con l’uscita RCA Master e XLR e il terminale di uscita TRS jack Booth. Utilizza i grandi Performance Pad multicolor per avviare all’istante le 11 funzioni Serato DJ Pro. Guardali mentre cambiano colore e illuminazione per mostrare la modalità pad selezionata e lo stato di riproduzione. E’ stata ridotta la latenza delle jog wheel per uno scratching ancor più omogeneo rispetto alla versione precedente. Ottimizzate per una perfetta risposta scratch, i marker dei punti di cue illuminati con conto alla rovescia ti offrono un controllo agevole, senza neppure dover guardare il portatile. Sono inclusi il Pitch’n Time DJ e Serato Flip Expansion Pack. Utilizza funzioni avanzate quali Key Shift, Key Sync, Flip, Pitch Play e molte altre per mix fluidi dei brani. Caratteristiche Software: Serato DJ Pro (precedentemente noto come Serato DJ) Risposta in frequenza: 20Hz – 20kHz Rapporto S/N: 107dB (USB), 96dB (Line), 87dB (Phono), 80dB (Mic) THD: 0,003% (USB), 0,005% (Line) Ingressi: Line / Phono x2 (RCA), Line x2 (RCA), MIC x3 (XLR e jack TRS da 1/4″ x1, XLR x1, jack TRS 1/4″ x1) Uscite: Master x2 (XLR x1, RCA x1), Booth Out x1 (TRS da 1/4 “), Phones x2 (presa jack stereo 1/4” x1, mini jack stereo 3,5mm x1) USB: USB (tipo B) x2 Accessori: Alimentatore, cavo di alimentazione, cavo USB, guida rapida, voucher di espansione Serato DJ Pro (Serato Flip e Pitch’n Time DJ) Dimensioni: 664 x 354 x 70mm Peso: 6,1kg', '1099.00', '100', '0', 'https://musicalstudio.net/wp-content/uploads/14125535.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Microfono Live Beyerdynamic Tgv50d', 'Microfono dinamico cardioide di qualità. Indicato per uso vocale, con corpo interamente metallico. Microfono di buon livello si contrappone a Shure SM58 e Beta58 ma con una superiore sensibilità limitando leffetto Larsen. La risposta in frequenza denota una ricchezza di frequenze alte e basse rispetto i concorrenti. Microfono di ottima rotazione. La confezione contiene: microfono, custodia morbida e supporto per asta.Beyerdynamic TG V50d, microfono vocale dinamico, cardioide, 50 – 17.000 Hz Dimensioni, 600 Ohm, lunghezza: 167mm, diametro 23/35mm, testa diametro 54mm, peso 270g, incl. Morsetto, sostituzione del TG-X 48/58', '99.00', '30', '0', 'https://musicalstudio.net/wp-content/uploads/1101D825.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Accessori Microfono Shure Wa723 Gold Cover Glxd', 'WA723 IMPUGNATURA COLORATA PER IL TRASMETTITORE GLXD24 Shure porta nuove scelte di colore agli artisti di ogni genere per i suoi microfoni leggendari. Disponibili per i modelli a mano della serie glxd24 e costruiti per soddisfare gli esigenti standard di qualità Shure. Un semplice processo di installazione e di rimozione consente di passare facilmente tra le varie colorazioni.', '39', '20', '2', 'https://musicalstudio.net/wp-content/uploads/1110G316.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Chitarra Classica Sakura 920 1/2 Con Borsa', ' ', '69', '10', '0', 'https://musicalstudio.net/wp-content/uploads/0202W814.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Chitarra Elettrica Eko Aire Standard', 'CHITARRA ELETTRICA NATURALE Le chitarre Elements Standard sono costruite sulla base delle Masterbuilt della stessa serie, disegnate e progettate in Italia. Queste chitarre dal prezzo più contenuto rispetto alle versioni Made in Italy, sono pensate per chi, con un budget limitato è alla ricerca di uno strumento di buona qualità che lo accompagni in studio, in stage o per esercitarsi. Le versioni Standard mantengono le stesse linee sinuose delle ammiraglie ed quindi il loro fascino tridimensionale. Caratteristiche principali Tavola: Ontano Fondo e fasce: Ontano Tastiera: Acero, Bolt on Raggio: Variabile Manico: Acero, C Profile Intarsi: Logo tribale al XII tasto Meccaniche: Nere Controlli: Volume / Tono / Tono Manopole: Ebano Battipenna: Legno Ponte: Tremolo Wilkinson 100 Finitura: Naturale a base d’acqua', '379', '300', '10', 'https://musicalstudio.net/wp-content/uploads/0201Q512.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Batteria Elettronica Roland Td-17 Kvx + Cuffia Omaggio', 'ROLAND TD-17 KVX BATTERIA ELETTRONICA COMPLETA La batteria elettronica Roland TD-17 KVX, come la sorella minoreTD-17 KV, è per chi vuole fare sul serio. Nata dalla combinazione di un modulo sonoro della stessa portata del TD-50 con pad di nuovo sviluppo, questo drumkit elettronico è all’altezza delle ambizioni dei batteristi che vogliono esercitarsi e crescere. TD-17 KVX ricrea in modo autentico lesperienza esecutiva dello strumento acustico  rispecchiando accuratamente i movimenti fisici, la coordinazione tra le bacchette e il controllo di mani e piedi indispensabile per ogni batterista. Allo stesso tempo, un insieme di funzioni interne dedicate allo studio e allesercizio tengono traccia della vostra tecnica, misurano i vostri progressi e fanno crescere la vostra motivazione. Diventare un batterista migliore è sempre un duro lavoro, ma la TD-17 KVX può aiutarvi a raggiungere la meta. Caratteristiche Roland TD-17 KVX Modulo Sonoro: TD-17Rullante: PDX-12Tom: PDX-8 (x 3)Hi-Hat: VH-10Crash: CY-12C (x 2)Ride: CY-13RGrancassa: KD-10Stand: MDS-4KVXDimensioni: 1300 x 1100 x 1200 mmPeso: 24.8 KgAccessori inclusi Supporto per modulo sonoroAlimentatoreCavo di connessioneDrum keyBullone a manopola per PDX-12Absorption plate per VH-10Legatura per VH-10Guida al setupManuale d’usoN.B. Il pedale cassa e il supporto charleston non sono inclusi nella promozione.', '1599', '2', '20', 'https://musicalstudio.net/wp-content/uploads/05020827.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Basso Elettrico 4 Corde Eko Vjb-200 Black', 'La serie Starter nasce per offrire la possibilità a tutti i chitarristi e bassisti, in particolar modo i principianti, di avere uno strumento con caratteristiche simili a modelli di chitarra e basso che hanno fatto la storia della musica. Grazie al fantastico rapporto qualità/prezzo, questi strumenti di fascia economica riescono facilmente a soddisfare l’idea e la voglia di suonare uno strumento dal design classico.Basso a 4 corde con manico in acero di tipo bolt on e corpo corpo in tiglio. Truss rod doppia azione sotto una tastiera in palissandro o acero (s). Il ponte è in stile vintage a 4 sellette', '209', '0', '0', 'https://musicalstudio.net/wp-content/uploads/0301Q522.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Basso Elettrico 4 Corde Eko Vjb-200 Sunburst', 'serie Starter nasce per offrire la possibilità a tutti i chitarristi e bassisti, in particolar modo i principianti, di avere uno strumento con caratteristiche simili a modelli di chitarra e basso che hanno fatto la storia della musica. Grazie al fantastico rapporto qualità/prezzo, questi strumenti di fascia economica riescono facilmente a soddisfare l’idea e la voglia di suonare uno strumento dal design classico.Basso a 4 corde con manico in acero di tipo bolt on e corpo corpo in tiglio. Truss rod doppia azione sotto una tastiera in palissandro o acero (s). Il ponte è in stile vintage a 4 sellette', '209', '50', '20', 'https://musicalstudio.net/wp-content/uploads/0301Q521.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Basso Elettrico 4 Corde Oqan Qbe-pb35 Sb Kit', 'Pack basso elettrico. Comprende basso tipo Precision Bass e accessori. Basso con corpo in tiglio massello. Tastiera in acero 21 tasti. Manico in palissandro. 1 pickup tipo PB.Ponte Vintage. 1 controllo volume, 1 controllo tono. Paletta tipo vintage. Accessori inclusi: custodia, accordatore digitale, cavo, cinghia e 3 plettri.', '199', '10', '1', 'https://musicalstudio.net/wp-content/uploads/0301J910.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Da Palco Roland Rd88', 'Keyboard88 keys (PHA-4 Standard Keyboard: with Escapement and Ivory Feel)Da oltre trentanni, i pianoforti RD sono la scelta dei professionisti, serata dopo serata, sui palchi di tutto il mondo. Uno dei motivi è la loro suonabilità, e la loro capacità di farvi sentire connessi allo strumento quando ne suonate uno. Avete a disposizione dei controlli solidi e una meccanica della tastiera efficiente e affidabile, dalla risposta naturalemai troppo rigida, mai troppo molle.Uno stage piano di qualità deve offrire suoni autentici e avere carattere. RD-88 è dotato di nuovi timbri di pianoforte e di piano elettrico SuperNATURAL capaci di passare da un carattere brillante ad uno grintoso con la semplice modifica di pochi parametri. Per una versatilità ancora maggiore abbiamo incluso unaccurata selezione di suoni acustici ed elettronici dalla nostra libreria storica che utilizzano lo stesso generatore sonoro dei nostri sintetizzatori al top della gamma.Integrazione con i soft synth.A volte vi serve un suono molto specifico, o un particolare soft synth o una libreria di sample. RD-88 ha tre zone che possono essere configurate con i suoni interni, o che possono integrare e controllare soft synth da Apple MainStage. Questo rende semplice ricreare dal vivo i timbri di una registrazione o mixare i vostri soft synth preferiti con quelli interni di RD-88.Size and WeightDimensions 1,284 (W) x 258 (D) x 159 (H) mminchesWeight13.5 kg', '1198', '2', '0', 'https://musicalstudio.net/wp-content/uploads/19010838.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Con Mobile Yamaha Clp565gp', 'La serie Clavinova CLP porta a casa vostra, nel vostro studio o nello spazio in cui si suona, il suono perfetto di un pianoforte. La generazione di suoni Advanced Wave Memory (AWM) di questo pianoforte utilizza svariati campioni da un autentico pianoforte a coda per produrre tutte le note', '3698', '0', '0', 'https://musicalstudio.net/wp-content/uploads/1902G430.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Con Mobile Yamaha Ydp-s34 White', 'PIANOFORTE DIGITALE 88 TASTI BIANCO Gli spazi della vita moderna possono essere accoglienti, ma spesso non sono molto ampi, quindi bisogna essere creativi nel reinventare i nostri ambienti. Il pianoforte digitale Arius YDP-S34 ti aiuta ad esprimere questa creatività grazie ad un design elegante e compatto che aggiunge stile ad ogni ambiente, offrendo allo stesso tempo una qualità del suono straordinaria. La vita può essere movimentata, ma abbiamo bisogno di prenderci il tempo per fare le cose che amiamo. Con il pianoforte digitale Arius YDP-S34, puoi contare su uno strumento di alta qualità, ma anche su un elegante pezzo di arredamento. Semplicemente si adatta al tuo spazio. E’ stato progettato per farti sperimentare un vero pianoforte acustico. Sebbene l’YDP-S34 vanti un look moderno ed elegante, offre la sensazione di suonare un pianoforte acustico tradizionale. Yamaha vanta un patrimonio di oltre un secolo nella costruzione di pianoforti acustici ed ha sfruttato questa esperienza nel progettare e costruire pianoforti digitali. Dal momento in cui apri il coperchio, ti siedi ed inizi a suonare, sarai immerso nel suono di un pianoforte da concerto a coda Yamaha CFX. Gli 88 tasti Graded Hammer Standard riproducono il tocco di un pianoforte a coda, offrendoti la sensazione di un’autentico pianoforte acustico. Caratteristiche Tasti: 88 Tastiera Standard: GHS (Graded Hammer) con copritasti nero opaco Touch Sensitivity: Hard / Medium / Soft / Fixed Numero di pedali: 3 Half Pedal: Si Funzioni: Damper / Sostenuto / Soft Copritastiera: Pieghevole Leggio: Si Tecnologia di generazione del suono: Yamaha CFX Polifonia: 192 Voci Numero di voci preimpostate: 10 Effetti: Riverbero (quattro tipi) Intelligent Acoustic Control (IAC): Si Stereophonic Optimizer: Si Risonanza degli smorzatori: Si Dual / Layer: Si Duo: Si Numero di brani preimpostati: 10 brani dimostrativi, 50 brani per pianoforte preimpostati Registrazione: Numero di brani 1, Numero di tracce 2 Capacità dati: 100 KB per brano (circa 11000 note) Formato di riproduzione: SMF (formato 0, formato 1) Formato di registrazione: SMF (formato 0) Metronomo: Si Intervallo di tempo: 5 – 280 Transpose: Da -6 a 0,0 a +6 Accordatura: 414,8 – 440,0 – 466,8Hz Memoria interna: 900KB (song utente: circa 100KB per brano, caricamento dei dati dei brani da un pc: fino a 10 brani) Cuffie: 2x Jack standard USB to Host: Si Amplificatori: 8W x2 Altoparlanti: 12cm x2 Ottimizzatore acustico: Si Alimentazione: PA-150B o equivalente raccomandato da Yamaha Spegnimento automatico: Si Consumo energetico: 9W (quando si utilizza un alimentatore PA-150B) Accessori inclusi: Song Book, 50 capolavori di musica classica Alimentatore: PA-150B o equivalente raccomandato da Yamaha Dimensioni: 1353 x H792 x 296mm Peso: 35,9kg', '879', '100', '0', 'https://musicalstudio.net/wp-content/uploads/1902G411.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Con Mobile Yamaha Ydp-s34 Black', 'PIANOFORTE DIGITALE 88 TASTI NERO Gli spazi della vita moderna possono essere accoglienti, ma spesso non sono molto ampi, quindi bisogna essere creativi nel reinventare i nostri ambienti. Il pianoforte digitale Arius YDP-S34 ti aiuta ad esprimere questa creatività grazie ad un design elegante e compatto che aggiunge stile ad ogni ambiente, offrendo allo stesso tempo una qualità del suono straordinaria. La vita può essere movimentata, ma abbiamo bisogno di prenderci il tempo per fare le cose che amiamo. Con il pianoforte digitale Arius YDP-S34, puoi contare su uno strumento di alta qualità, ma anche su un elegante pezzo di arredamento. Semplicemente si adatta al tuo spazio. E’ stato progettato per farti sperimentare un vero pianoforte acustico. Sebbene l’YDP-S34 vanti un look moderno ed elegante, offre la sensazione di suonare un pianoforte acustico tradizionale. Yamaha vanta un patrimonio di oltre un secolo nella costruzione di pianoforti acustici ed ha sfruttato questa esperienza nel progettare e costruire pianoforti digitali. Dal momento in cui apri il coperchio, ti siedi ed inizi a suonare, sarai immerso nel suono di un pianoforte da concerto a coda Yamaha CFX. Gli 88 tasti Graded Hammer Standard riproducono il tocco di un pianoforte a coda, offrendoti la sensazione di un’autentico pianoforte acustico. Caratteristiche Tasti: 88 Tastiera Standard: GHS (Graded Hammer) con copritasti nero opaco Touch Sensitivity: Hard / Medium / Soft / Fixed Numero di pedali: 3 Half Pedal: Si Funzioni: Damper / Sostenuto / Soft Copritastiera: Pieghevole Leggio: Si Tecnologia di generazione del suono: Yamaha CFX Polifonia: 192 Voci Numero di voci preimpostate: 10 Effetti: Riverbero (quattro tipi) Intelligent Acoustic Control (IAC): Si Stereophonic Optimizer: Si Risonanza degli smorzatori: Si Dual / Layer: Si Duo: Si Numero di brani preimpostati: 10 brani dimostrativi, 50 brani per pianoforte preimpostati Registrazione: Numero di brani 1, Numero di tracce 2 Capacità dati: 100 KB per brano (circa 11000 note) Formato di riproduzione: SMF (formato 0, formato 1) Formato di registrazione: SMF (formato 0) Metronomo: Si Intervallo di tempo: 5 – 280 Transpose: Da -6 a 0,0 a +6 Accordatura: 414,8 – 440,0 – 466,8Hz Memoria interna: 900KB (song utente: circa 100KB per brano, caricamento dei dati dei brani da un pc: fino a 10 brani) Cuffie: 2x Jack standard USB to Host: Si Amplificatori: 8W x2 Altoparlanti: 12cm x2 Ottimizzatore acustico: Si Alimentazione: PA-150B o equivalente raccomandato da Yamaha Spegnimento automatico: Si Consumo energetico: 9W (quando si utilizza un alimentatore PA-150B) Accessori inclusi: Song Book, 50 capolavori di musica classica Alimentatore: PA-150B o equivalente raccomandato da Yamaha Dimensioni: 1353 x H792 x 296mm Peso: 35,9kg', '879', '50', '0', 'https://musicalstudio.net/wp-content/uploads/1902G410.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Con Mobile Korg G1 Air – Black', 'PIANOFORTE DIGITALE NERO KORG G1 possiede un suono senza paragoni in grado di offrire un’esperienza esecutiva di grande espressività e bellezza, fissando così un nuovo standard per i pianoforti digitali. Il suono incredibilmente dettagliato e l’eccezionale risposta dinamica di G1 sono in grado di fornire al pianista tutte le sfumature espressive possibili. Con G1 KORG ha creato un pianoforte digitale unico, con un suono modellato in base ad un’esperienza e una tecnologia di decenni in questo settore, unito ad una tastiera in grado di riprodurre fedelmente ogni sfumatura dinamica dello strumento reale dal pianissimo al fortissimo. La tecnologia con cui è stato realizzato G1 è così avanzata da non avere avuto ancora alcuna applicazione, il risultato è uno strumento di incredibile livello, realizzato senza compromessi tra sonorità e design, con un mobile dalla linea sottile costruito e rifinito accuratamente ed un’amplificazione interna di grande potenza e dinamica. L’unione di questi elementi immerge l’esecutore in una sensazione sonora pressochè unica. Una volta suonato ed ascoltato, KORG G1 cambierà per sempre la vostra percezione dei pianoforti digitali. Caratteristiche principali Il suono dei tre dei migliori pianoforti a coda da concerto di tutto il mondo Tastiera 88 tasti RH3 (Real Weighted Hammer Action 3) Campionamenti multi-layer di incredibile realismo Riproduzione digitale della risonanza delle corde e del pedale del piano a coda La tastiera RH3 in grado di simulare con grande precisione tocco e la risposta di un pianoforte acustico Sistema d’amplificazione di nuova concezione Cabinet dal design contemporaneo Colore: Black/Nero Riproduzione audio via Bluetooth (solo modelli “Air”)', '1199', '20', '0', 'https://musicalstudio.net/wp-content/uploads/19021717.jpg');
INSERT INTO `music_store`.`product` (`name`, `description`, `price`, `disponibility`, `shippingPrice`, `imagePath`) VALUES ('Piano Con Mobile Korg C1 Air Bk', 'PIANOFORTE DIGITALE BLUETOOTH NERO C1 è un pianoforte digitale veramente eccezionale, ulteriore espressione di tutta la storia e l’esperienza Korg nel settore degli strumenti musicali e della tecnologia audio. Questo strumento offre un altissimo grado di versatilità e di suonabilità che supera le aspettative anche del pianista più esigente. Sarete stupiti e conquistati fin dalla prima nota di questo strumento, grazie alla profondità e alla limpidezza del suono, proveniente dal suo cabinet elegante e sottile. La tastiera appositamente progettata offre una sensazione tattile ed una risposta studiata sia per aiutare lo studente a sviluppare la propria tecnica esecutiva, sia per rispondere pienamente alle esigenze del musicista più esigente. Korg C1 è uno strumento avanzatissimo ed una valida alternativa ad uno strumento acustico, nello stesso tempo presenta molti vantaggi rispetto a questultimo: è possibile ad esempio utilizzarlo in luoghi dove uno strumento tradizionale potrebbe non essere utilizzabile, non ha bisogno di accordatura, e può essere suonato ascoltandolo in cuffia per evitare di disturbare. Inoltre una serie di funzioni aggiuntive possono essere fonte di ispirazione per gli utenti di ogni livello, migliorando il livello di fruizione della musica, inclusi le sonorità di 30 superbi realistici strumenti, registrazione e audio streaming via Bluetooth. Progettato e realizzato in Giappone, Korg C1 ridefinisce il concetto stesso di pianoforte digitale. Caratteristiche Pianoforti a coda di prima classe giapponesi e tedeschi, oltre a decine di altri grandi suoni Simulazione della risonanza simpatetica, della sordina e del key-off (rilascio dei tasti) 30 suoni totali più 3 effetti da studio regolabili per una flessibilità musicale superba 120 voci di polifonia La tastiera RH3 di alta qualità offre la vera sensazione di suonare un pianoforte acustico Funzione layer e split della tastiera La modalità Partner divide la tastiera in due per i duetti studenti / insegnanti Pedali damper, soft e sostenuto Ricevitore audio Bluetooth Sistema di altoparlanti full-range Il design elegante del mobile si fonde elegantemente con il tuo arredamento Line out, MIDI I/O, 2 uscite stereo per cuffie Dimensioni: 1346 x 347 x 770mm Peso: 35kg', '99', '30', '0', 'https://musicalstudio.net/wp-content/uploads/19021712.jpg');
